const [showView,  setShowView] = useState(true)


function Table({ data }){



    return(
        <div className="middle">
       
        <table>
        <tr>
          <th>Description</th>
          <th>Password</th>
          <th>Actions</th>
        </tr>
        {
            data.map((element) => 
            <tr>
                <td>{element.desc}</td>
                <td>{ element.pass }</td>
            <td >
            <button  className="view-btn" onClick={() => setShowView(true)}>View</button>
            
            <button className="delete-btn">Delete</button>
            </td>
            
            </tr>
            )
        }
        
             </table>
        </div>
    )
}


export default Table;
